import { Link } from "react-router-dom";
import "./Navbar.css"
import * as React from 'react';
import ReactDOM from 'react-dom';
import {Tabs, Tab, Box, TabP} from '@mui/material/Tabs';

export default function Navbar() {
  return (
    <>

      <nav>
        <ul>
          <li>
            <a href="/" className="brand-name">
              Shortly
            </a>
          </li>
          <li>
            <Link to="/shortenLink">Sign in</Link>
          </li>
          <li>
            <Link to="/upgradeLink">Upgrade link</Link>
          </li>
        </ul>
      </nav>
    </>
  );
}
